// 这是一个查货核对的订单

// 引入react 
import React from 'react'
// 引入navs组件
import Navs from '../../../componets/nav'

// 引入ui库的input标签

// 引入DuvINp 组件
import InpDiv from '../../../componets/inp-shade'
class Chahuo extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div>
                <Navs name="查货核对" />
                <div>
                    <div className={IndexCss}>
                        <InpDiv name="出货单号" />
                    </div>
                    <div className={IndexCss}>
                        <InpDiv name="出货箱" />
                    </div>
                </div>
            </div>
        );
    }
}

export default Chahuo;
